DROP TABLE IF EXISTS `xs_commodity`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `xs_commodity` (
  `cid` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(45) NOT NULL DEFAULT '',
  `group_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '同组sku物品共属的组id',
  `name_zh_tw` varchar(45) NOT NULL DEFAULT '' COMMENT '台湾版名称',
  `name_en` varchar(45) NOT NULL DEFAULT '' COMMENT '英文版名称',
  `name_ar` varchar(128) NOT NULL DEFAULT '' COMMENT '阿语版',
  `name_ms` varchar(128) NOT NULL DEFAULT '' COMMENT '马来语版',
  `name_th` varchar(128) NOT NULL DEFAULT '' COMMENT '泰语版',
  `name_id` varchar(128) NOT NULL DEFAULT '' COMMENT '印度尼西亚',
  `name_vi` varchar(128) NOT NULL DEFAULT '' COMMENT '越南语',
  `name_ko` varchar(128) NOT NULL DEFAULT '' COMMENT '韩语版',
  `name_jp` varchar(128) NOT NULL DEFAULT '' COMMENT '日语版',
  `name_pt` varchar(128) NOT NULL DEFAULT '' COMMENT '葡语版',
  `name_es` varchar(128) NOT NULL DEFAULT '' COMMENT '西语版',
  `type` enum('exp','box','key','header','title','gift','defend','radio-defend','coupon','mounts','piece','experience_voucher','bubble','ring','effect','decorate','union_box','union_header','marry_ring','lottery_coupon','nobility_experience_card','lottery','chip','visitor_notebook','relationship_card','bundle','pet','pet_returned') DEFAULT NULL COMMENT '经验值（exp）,箱子（box),钥匙(key),头像框(header),爵位(title),礼物(gift),守护(defend),电台守护(radio-defend),优惠券(coupon),坐骑(mounts),碎片(piece),体验券(experience_voucher),聊天气泡(bubble),ring(戒指),effect(特效),decorate(主页装扮),union_box(联盟箱子),union_header(联盟头像框),marry_ring(婚戒),疯狂转盘抽奖券(lottery_coupon),nobility_experience_card(爵位体验卡), lottery(抽奖), chip(碎片) visitor_notebook(访客记录本) relationship_card(关系牌), bundle(套装组合), pet(宠物), pet_returned(宠物返礼)',
  `sub_type` varchar(64) NOT NULL DEFAULT '' COMMENT '子类型名',
  `description` varchar(512) NOT NULL DEFAULT '' COMMENT '物品描述',
  `price` int(11) NOT NULL DEFAULT '0' COMMENT '价格',
  `image` varchar(1024) CHARACTER SET latin1 NOT NULL DEFAULT '' COMMENT '图标地址',
  `image_bg` varchar(256) NOT NULL DEFAULT '' COMMENT '背景图',
  `image_zh_tw` varchar(512) DEFAULT '' COMMENT '图标地址台湾版',
  `image_en` varchar(512) DEFAULT '' COMMENT '图标地址英文版',
  `image_ar` varchar(512) DEFAULT '' COMMENT '图标地址海外版',
  `period` int(11) NOT NULL DEFAULT '0' COMMENT '有效期，精确到天',
  `period_hour` int(11) NOT NULL DEFAULT '0',
  `only_newpay` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否必须为新支付',
  `duction_money` int(11) NOT NULL DEFAULT '0' COMMENT '优惠券抵扣的钱，单位分',
  `ext_id` int(11) NOT NULL DEFAULT '0' COMMENT '类型为礼物优惠券时可使用的物品id\n类型为守护、电台守护、爵位优惠券时表示物品的等级\n类型为爵位时表示爵位的等级\n类型为守护、电台守护时表示守护的等级\n类型为礼物时表示礼物的gid',
  `ext_name` varchar(45) NOT NULL DEFAULT '' COMMENT '优惠券适用的物品名称',
  `jump_page` varchar(512) NOT NULL DEFAULT '' COMMENT '可跳转的页面',
  `coupon_type` enum('none','defend','radio-defend','title','gift','key') NOT NULL DEFAULT 'none' COMMENT '优惠券的类型',
  `dateline` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `is_continue` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否续费才能用',
  `can_opened_by_box` tinyint(4) NOT NULL DEFAULT '0' COMMENT '头像框、坐骑能否在开箱子中开出来',
  `saling_on_shop` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0非售卖,1商城售卖,2金币商城,3碎片商城,4联盟银币商城,5联盟特权商城',
  `can_give` tinyint(1) NOT NULL DEFAULT '1' COMMENT '物品是否能够赠送 1代表可以 0代表不可以 默认可以赠送',
  `title` tinyint(4) NOT NULL DEFAULT '0' COMMENT '最低爵位等级',
  `ext_id_more` int(11) NOT NULL DEFAULT '0',
  `extra` varchar(255) DEFAULT '' COMMENT '配置信息',
  `startline` int(11) NOT NULL DEFAULT '0' COMMENT '开始使用时间',
  `endline` int(11) NOT NULL DEFAULT '0' COMMENT '结束使用时间',
  `tag_ids` varchar(255) NOT NULL DEFAULT '' COMMENT '物品标签,多个id以应文:隔开,如 1:2',
  `money_type` enum('money','coin','piece','union_gold','union_silver') NOT NULL DEFAULT 'money' COMMENT 'money伴伴币,coin金币,piece碎片,union_god联盟金币,union_silver联盟银币',
  `excludes` varchar(255) DEFAULT '' COMMENT 'zh_cn中文版，zh_tw台湾版，en英文版，ar阿语版，my马来语版，th泰语版，id印尼语版，vn越南语版，ko韩语版，tr土耳其版，ja日语版',
  `name_tr` varchar(128) NOT NULL DEFAULT '' COMMENT '土耳其版名称',
  `special_type` int(10) DEFAULT '0' COMMENT '是否特殊礼物，0：否，1：直播粉丝团礼物',
  `app_id` tinyint(4) unsigned NOT NULL DEFAULT '5' COMMENT '限定app_id',
  `name_ja` varchar(128) NOT NULL DEFAULT '' COMMENT '日语名称',
  `commodity_level` enum('C','B','A','S') NOT NULL DEFAULT 'C' COMMENT 'C: 精美（普通可购买）白色品质, B: 稀有， 蓝色品质, A: 史诗 紫色品质, S: 传说 橙色品质',
  `usage_period` int(11) NOT NULL DEFAULT '0' COMMENT '可使用天数',
  PRIMARY KEY (`cid`),
  KEY `idx_type` (`type`),
  KEY `idx_group_id` (`group_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4032 DEFAULT CHARSET=utf8mb4 COMMENT='统一的物品表';
